background-color: green;
padding: 2px;
display: flex;
flex-direction: column;`
export default function Nav({onSearch}){
    return (
    <Divagando>
      <Link to='about'>
        trolim.
      </Link>
    <SearchBar 
      onSearch={onSearch} />
  </Divagando>
    )
}
